import logo from './logo.svg';
import './App.css';
import TextField from '@mui/material/TextField';
import Checkbox from '@mui/material/Checkbox';

import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select, { SelectChangeEvent } from '@mui/material/Select';

import Button from '@mui/material/Button';


function App() {
  return (
    <div  >

<div className='body'>
  <TextField sx={{ m: 1, minWidth: 400 }} placeholder='First name' />
  </div>

<div className='body'><TextField sx={{ m: 1, minWidth: 400 }}  className='Textfield'  placeholder='Last name' /></div>

<div className='body'>
<div> Male : < Checkbox/> </div>

<div> Female : <Checkbox /> </div>
<div> Others : <Checkbox/> </div>

</div>

<div className='body'>
<FormControl sx={{ m: 1, minWidth: 400 }} >
        <InputLabel >Country</InputLabel>
        <Select>
          <MenuItem  value={'India'}>India</MenuItem>
          <MenuItem value={'Afganistan'} >Afganistan</MenuItem>
          <MenuItem value={'Australia'}>Australia</MenuItem>
          <MenuItem value={'Bangladesh'}>Bangladesh</MenuItem>
          <MenuItem value={'Brazil'}>Brazil</MenuItem>
          <MenuItem value={'China'}>China</MenuItem>
          <MenuItem value={'France'}>France</MenuItem>
          <MenuItem value={'Italy'}>Italy</MenuItem>


        </Select>
      </FormControl>
</div>

<div className='body'><TextField  sx={{ m: 1, minWidth: 400 }} className='Textfield'  placeholder='State' /></div>
<div className='body'><TextField sx={{ m: 1, minWidth: 400 }}  className='Textfield'  placeholder='Phone Number' /></div>
<div className='body'><TextField sx={{ m: 1, minWidth: 400 }} className='Textfield'  placeholder='Email Address' /></div>


<Button sx={{ m: 1, minWidth: 400 }}  variant="outlined">Outlined</Button>


    </div>
  );
}

export default App;
